import React from 'react'

const Pokemon = ({ pokemon }) => {
    const { sprites } = pokemon
    const set = Object.entries(sprites)

    console.log(set)

    const displaySprites = set.map(sprite => {
        if(typeof sprite[1] === String){
            console.log(sprite[1])
        }
    })

    return (
        <div>
            Pokemon
        </div>
    )
}

export default Pokemon
